function App() {
  function getTrivia() {
    fetch("https://the-trivia-api.com/v2/questions")
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        data.map((data) => {
          if (data.category === "music") {
            console.log(data);
          }
        });
      })
      .catch((err) => console.error(err));
  }

  return (
    <div className="App">
      {/* <button onClick={getTrivia}>CLICK FOR TRIVIA</button> */}
      <h1>
        TRIVIA<span id="homeTitleSpan">SMASH</span>
      </h1>
      <div className="homeStartBtnGroup">
        <button>Create Game</button>
        <button>Join Lob</button>
      </div>
    </div>
  );
}

export default App;
